(134, 13, 1, '42fs|Shipping|Cake forno|A popular contemporary legend holds that the archetypal pizza, Pizza Margherita, was invented in 1889, when the Royal Palace of Capodimonte commissioned the Neapolitan pizzaiolo (pizza maker) Raffaele Esposito to create a pizza in honor of the visiting Queen Margherita. Of the three different pizzas he created. Ingredients: Croissants CSS Butter Code HTML Ignite fire jQuery Salt Slide Cheese|A popular contemporary legend holds that the archetypal pizza, Pizza Margherita, was invented in 1889, when the Royal Palace of Capodimonte commissioned the Neapolitan pizzaiolo (pizza maker) Raffaele Esposito to create a pizza in honor of the visiting Queen Margherita. Of the three different pizzas he created. Ingredients: Croissants CSS Butter Code HTML Ignite fire jQuery Salt Slide Cheese|62.5|1'),
