INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2015-01-27 08:34:47', '2015-01-27 08:34:49', 1),
(2, 'Footer Links Company', 'footer_links_company', '\n<div class="links">\n    <div class="block-title">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\n        <li><a href="{{store url=""}}contacts/">Contact Us</a></li>\n        <li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\n        <li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\n    </ul>\n</div>', '2015-01-27 08:34:49', '2015-01-27 08:34:49', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2015-01-27 08:34:49', '2015-01-27 08:34:49', 1),
(4, 'testimonials1', 'testimonials1', '<div class="container">\r\n<div class="testimonial centered-columns">\r\n<div class="centered-column testimonial-avatar-wrapper">\r\n<div class="testimonial-avatar-container">\r\n<div class="testimonial-avatar"><img src="{{media url="wysiwyg/onethemes/bakery/blog/avatar1.jpg"}}" alt="" /></div>\r\n</div>\r\n</div>\r\n<div class="testimonial-name">Brandon Razer</div>\r\n<div class="centered-column">\r\n<div class="testimonial-content">&ldquo;All you need is love. But a little chocolate now and then doesn''t hurt.&rdquo;</div>\r\n</div>\r\n</div>\r\n</div>', '2015-01-31 08:14:40', '2015-02-24 07:18:44', 1),
(5, 'testimonials2', 'testimonials2', '<div class="container">\r\n<div class="testimonial centered-columns">\r\n<div class="centered-column testimonial-avatar-wrapper">\r\n<div class="testimonial-avatar-container">\r\n<div class="testimonial-avatar"><img src="{{media url="wysiwyg/onethemes/bakery/blog/avatar2.jpg"}}" alt="" /></div>\r\n</div>\r\n</div>\r\n<div class="testimonial-name">Brandon Razer</div>\r\n<div class="centered-column">\r\n<div class="testimonial-content">&ldquo;All you need is love. But a little chocolate now and then doesn''t hurt.&rdquo;</div>\r\n</div>\r\n</div>\r\n<!-- .testimonial --></div>', '2015-01-31 08:22:00', '2015-02-24 08:13:04', 1),
(6, 'testimonials3', 'testimonials3', '\r\n<div class="container">\r\n                        <div class="testimonial centered-columns">\r\n                            <div class="centered-column testimonial-avatar-wrapper">\r\n                                <div class="testimonial-avatar-container">\r\n                                    <div class="testimonial-avatar">\r\n                                        <img src="{{media url="wysiwyg/onethemes/bakery/blog/avatar1.jpg"}}" alt="" />\r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                            <div class="testimonial-name">Charles M. Schulz</div>\r\n                            <div class="centered-column">\r\n                                <div class="testimonial-content">\r\n                                    “All you need is love. But a little chocolate now and then doesn''t hurt.”\r\n                                </div>\r\n                            </div>\r\n                        </div><!-- .testimonial -->\r\n                    </div>', '2015-01-31 08:22:23', '2015-02-24 08:14:43', 1),
(7, 'footer-top-1', 'footer-top-1', '<h4>About</h4>\r\n<p>Bakery is a PSD Template with great options and a lot of features. But it may possibly be conceived that, in the internal parts of the whale, in his anatomy there, at least, we shall be able to hit.</p>\r\n<div class="margin-50">&nbsp;</div>', '2015-01-31 08:25:57', '2015-02-27 06:43:54', 1),
(8, 'footer-top-2', 'footer-top-2', '<p class="logo-footer"><img src="{{media url="wysiwyg/onethemes/bakery/blog/logo2.png"}}" alt="" /></p>\r\n<div class="margin-50">&nbsp;</div>', '2015-01-31 08:27:37', '2015-02-27 06:55:54', 1),
(9, 'footer-top-3', 'footer-top-3', '<div class="subscribe">{{block type="newsletter/subscribe" name="newsletter" template="newsletter/subscribe.phtml"}}</div>\r\n<div class="margin-50">&nbsp;</div>', '2015-01-31 08:28:24', '2015-02-27 06:44:50', 1),
