(24, 'contact-sdt', 'contact-sdt', '<div class="contact-adress">\r\n<div class="adress">\r\n<div class="article-header">\r\n<h1>Contact</h1>\r\n</div>\r\n<p>He turned, stared, bawled something about "crawling out in a thing like a dish cover," and ran on to the gate of the house at the crest. A sudden whirl of black smoke driving across the road hid him for a moment.</p>\r\n<div class="margin-20">&nbsp;</div>\r\n<p>T: 0 800 500 55 123 465</p>\r\n<p>A: Johny Bravo, Street Number, City</p>\r\n<p>E: info@yourdomain.com</p>\r\n</div>\r\n<div class="margin-10">&nbsp;</div>\r\n<div class="icon-contact">\r\n<div class="article-header">\r\n<h1>Socialize</h1>\r\n</div>\r\n<div class="social-icon-container-alt"><a href="#"><em class="fa fa-facebook">&nbsp;</em></a></div>\r\n<div class="social-icon-container-alt"><a href="#"><em class="fa fa-twitter">&nbsp;</em></a></div>\r\n<div class="social-icon-container-alt"><a href="#"><em class="fa fa-rss">&nbsp;</em></a></div>\r\n<div class="social-icon-container-alt"><a href="#"><em class="fa fa-pinterest">&nbsp;</em></a></div>\r\n<div class="social-icon-container-alt"><a href="#"><em class="fa fa-tumblr">&nbsp;</em></a></div>\r\n<div class="social-icon-container-alt"><a href="#"><em class="fa fa-skype">&nbsp;</em></a></div>\r\n</div>\r\n</div>', '2015-03-06 22:01:26', '2015-03-07 06:40:40', 1);
