(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '\n<div class="page-title"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class="disc">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class="disc">\n            <li><a href="#" onclick="history.go(-1); return false;">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a>\n            <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n', '2015-01-27 08:34:48', '2015-01-27 08:34:48', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'one_column', NULL, NULL, 'home', NULL, '<div class="page-title">\r\n<h2>Home Page</h2>\r\n</div>', '2015-01-27 08:34:48', '2015-03-04 21:44:55', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
(3, 'About Us', 'one_column', NULL, NULL, 'about-magento-demo-store', NULL, '<div id="quote-section">\r\n<div class="quote">We work all the time with our customers and together we are able to create beautifull and amazing things that surely brings positive results and complete satisfaction.</div>\r\n</div>\r\n<div id="about-section">\r\n<div class="section-content">\r\n<div class="section-header">\r\n<h1>About Bakery &amp; cakery</h1>\r\n<p>See our big range of departaments, whe offer a lot of attention to our patients<br /> see what fits you and give us a call</p>\r\n</div>\r\n<div class="row">\r\n<div class="col-md-6 onscroll-animate"><img src="{{media url="wysiwyg/onethemes/bakery/blog/cup_and_logo.png"}}" alt="" /></div>\r\n<div class="col-md-6 onscroll-animate" data-delay="400">\r\n<div class="article-header-2">\r\n<h1>The Story Of Our Success</h1>\r\n</div>\r\n<p>Just thirty days after my advent upon Barsoom we entered the ancient city of Thark, from whose long-forgotten people this horde of green men have stolen even their name. The hordes of Thark number some thirty thousand souls, and are divided into twenty-five communities. Each community has its own jed and lesser chieftains, but all are under the rule of Tal Hajus, Jeddak of Thark.</p>\r\n<div class="margin-20">&nbsp;</div>\r\n<p>We made our entry into the great central plaza early in the afternoon. There were no enthusiastic friendly greetings for the returned expedition. Those who chanced to be in sight spoke the names of warriors or women with whom they came in direct contact, in the formal greeting of their kind.</p>\r\n<div class="margin-20">&nbsp;</div>\r\n<div class="row">\r\n<div class="col-xs-6">\r\n<div class="item-check">100% Responsive</div>\r\n<div class="item-check">RETINA READY ICONS</div>\r\n</div>\r\n<div class="col-xs-6">\r\n<div class="item-check">BOXED AND WIDE VERSION</div>\r\n<div class="item-check">NICE DOCUMENTATION</div>\r\n</div>\r\n</div>\r\n<div class="margin-70">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="section-content">\r\n<div class="container onscroll-animate">\r\n<div class="margin-40">&nbsp;</div>\r\n<h2 class="heading-huge">Video presentation</h2>\r\n<div class="margin-20">&nbsp;</div>\r\n<div class="embed-responsive embed-responsive-4by3"><iframe src="http://www.youtube.com/embed/OhtG_XahQco" width="100%" height="500"></iframe></div>\r\n<div class="margin-30">&nbsp;</div>\r\n</div>\r\n<!-- .container --></div>\r\n<!-- .section-content -->', '2015-01-27 08:34:48', '2015-03-02 06:50:46', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
